// @flow

import React, { Component } from 'react'
import { Map, Pane, Rectangle, TileLayer } from 'react-leaflet'

const outer = [[50.505, -29.09], [52.505, 29.09]]
const inner = [[49.505, -2.09], [53.505, 2.09]]

export default class PaneExample extends Component<{}, { render: boolean }> {
  state = {
    render: true,
  }

  interval: IntervalID

  componentDidMount() {
    this.interval = setInterval(() => {
      this.setState({
        render: !this.state.render,
      })
    }, 5000)
  }

  componentWillUnmount() {
    clearInterval(this.interval)
  }

  render() {
    return (
      <Map bounds={outer}>
        <TileLayer
          attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        {this.state.render ? (
          <Pane name="cyan-rectangle" style={{ zIndex: 500 }}>
            <Rectangle bounds={outer} color="cyan" />
          </Pane>
        ) : null}
        <Pane name="yellow-rectangle" style={{ zIndex: 499 }}>
          <Rectangle bounds={inner} color="yellow" />
          <Pane name="purple-rectangle" className="purplePane-purplePane">
            <Rectangle bounds={outer} color="purple" />
          </Pane>
        </Pane>
      </Map>
    )
  }
}
